define({"topics" : [{"title":"Destinations","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Destinations_overview.html#concept_hpr_twm_jq","attributes": {"data-id":"concept_hpr_twm_jq",},"menu": {"hasChildren":false,},"tocID":"concept_hpr_twm_jq-d46e84934","topics":[]},{"title":"Aerospike","shortdesc":"\n            <p class=\"shortdesc\">The Aerospike destination writes data to Aerospike.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Aerospike.html#concept_gyq_rpr_4cb","attributes": {"data-id":"concept_gyq_rpr_4cb",},"menu": {"hasChildren":true,},"tocID":"concept_gyq_rpr_4cb-d46e84958","next":"concept_gyq_rpr_4cb-d46e84958",},{"title":"Amazon S3","shortdesc":"\n            <p class=\"shortdesc\">The Amazon S3 destination writes data to Amazon S3. To write data to an Amazon Kinesis         Firehose delivery system, use\n               the Kinesis Firehose destination. To write data to Amazon         Kinesis Streams, use the Kinesis Producer destination.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/AmazonS3.html#concept_avx_bnq_rt","attributes": {"data-id":"concept_avx_bnq_rt",},"menu": {"hasChildren":true,},"tocID":"concept_avx_bnq_rt-d46e85015","next":"concept_avx_bnq_rt-d46e85015",},{"title":"Azure Data Lake Storage","href":"datacollector\/UserGuide\/Destinations\/DataLakeStore.html#concept_jzm_kf4_zx","attributes": {"data-id":"concept_jzm_kf4_zx",},"menu": {"hasChildren":true,},"tocID":"concept_jzm_kf4_zx-d46e85954","next":"concept_jzm_kf4_zx-d46e85954",},{"title":"Azure Event Hub Producer","href":"datacollector\/UserGuide\/Destinations\/AzureEventHubProducer.html#concept_xq5_d5q_1bb","attributes": {"data-id":"concept_xq5_d5q_1bb",},"menu": {"hasChildren":true,},"tocID":"concept_xq5_d5q_1bb-d46e86887","next":"concept_xq5_d5q_1bb-d46e86887",},{"title":"Azure IoT Hub Producer","href":"datacollector\/UserGuide\/Destinations\/AzureIoTHub.html#concept_pnd_jkq_1bb","attributes": {"data-id":"concept_pnd_jkq_1bb",},"menu": {"hasChildren":true,},"tocID":"concept_pnd_jkq_1bb-d46e86983","next":"concept_pnd_jkq_1bb-d46e86983",},{"title":"Cassandra","shortdesc":"\n            <p class=\"shortdesc\">The Cassandra destination writes data to a Cassandra cluster.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Cassandra.html#concept_hfy_mfd_sr","attributes": {"data-id":"concept_hfy_mfd_sr",},"menu": {"hasChildren":true,},"tocID":"concept_hfy_mfd_sr-d46e87139","next":"concept_hfy_mfd_sr-d46e87139",},{"title":"CoAP Client","shortdesc":"\n            <p class=\"shortdesc\">Constrained Application Protocol (CoAP) is a web transfer protocol designed for         machine-to-machine devices. The CoAP\n               Client destination writes data to a CoAP endpoint. Use         the destination to send requests to a CoAP resource URL.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/CoAPClient.html#concept_hw5_s3n_sz","attributes": {"data-id":"concept_hw5_s3n_sz",},"menu": {"hasChildren":true,},"tocID":"concept_hw5_s3n_sz-d46e87353","next":"concept_hw5_s3n_sz-d46e87353",},{"title":"Couchbase","shortdesc":"\n            <p class=\"shortdesc\">The Couchbase destination writes data to Couchbase Server. Couchbase Server is a         distributed NoSQL document-oriented\n               database.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Couchbase.html#concept_ahq_1wq_h2b","attributes": {"data-id":"concept_ahq_1wq_h2b",},"menu": {"hasChildren":true,},"tocID":"concept_ahq_1wq_h2b-d46e87452","next":"concept_ahq_1wq_h2b-d46e87452",},{"title":"Elasticsearch","shortdesc":"\n            <p class=\"shortdesc\">The Elasticsearch destination writes data to an Elasticsearch cluster, including Elastic         Cloud clusters (formerly\n               Found clusters) and Amazon Elasticsearch Service clusters. The         destination uses the Elasticsearch HTTP module to access\n               the Bulk API and write each record         to Elasticsearch as a document.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Elasticsearch.html#concept_u5t_vpv_4r","attributes": {"data-id":"concept_u5t_vpv_4r",},"menu": {"hasChildren":true,},"tocID":"concept_u5t_vpv_4r-d46e87509","next":"concept_u5t_vpv_4r-d46e87509",},{"title":"Einstein Analytics","shortdesc":"\n            <p class=\"shortdesc\">The Einstein Analytics destination writes data to Salesforce Einstein Analytics. The         destination connects to Einstein\n               Analytics to upload external data to a dataset.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/WaveAnalytics.html#concept_hlx_r53_rx","attributes": {"data-id":"concept_hlx_r53_rx",},"menu": {"hasChildren":true,},"tocID":"concept_hlx_r53_rx-d46e87804","next":"concept_hlx_r53_rx-d46e87804",},{"title":"Flume","shortdesc":"\n            <p class=\"shortdesc\">The Flume destination writes data to a Flume source. When you write data to Flume, you     pass data to a Flume client. The\n               Flume client passes data to hosts based on client configuration     properties. \n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Flume.html#concept_pzn_hl4_yr","attributes": {"data-id":"concept_pzn_hl4_yr",},"menu": {"hasChildren":true,},"tocID":"concept_pzn_hl4_yr-d46e88093","next":"concept_pzn_hl4_yr-d46e88093",},{"title":"Google BigQuery","href":"datacollector\/UserGuide\/Destinations\/BigQuery.html#concept_hj4_brk_dbb","attributes": {"data-id":"concept_hj4_brk_dbb",},"menu": {"hasChildren":true,},"tocID":"concept_hj4_brk_dbb-d46e88192","next":"concept_hj4_brk_dbb-d46e88192",},{"title":"Google Bigtable","href":"datacollector\/UserGuide\/Destinations\/Bigtable.html#concept_pl5_tmq_tx","attributes": {"data-id":"concept_pl5_tmq_tx",},"menu": {"hasChildren":true,},"tocID":"concept_pl5_tmq_tx-d46e88483","next":"concept_pl5_tmq_tx-d46e88483",},{"title":"Google Cloud Storage","href":"datacollector\/UserGuide\/Destinations\/GCS.html#concept_p4n_jrl_nbb","attributes": {"data-id":"concept_p4n_jrl_nbb",},"menu": {"hasChildren":true,},"tocID":"concept_p4n_jrl_nbb-d46e89064","next":"concept_p4n_jrl_nbb-d46e89064",},{"title":"Google Pub\/Sub Publisher","href":"datacollector\/UserGuide\/Destinations\/PubSubPublisher.html#concept_qsj_hk1_v1b","attributes": {"data-id":"concept_qsj_hk1_v1b",},"menu": {"hasChildren":true,},"tocID":"concept_qsj_hk1_v1b-d46e89994","next":"concept_qsj_hk1_v1b-d46e89994",},{"title":"Hadoop FS","href":"datacollector\/UserGuide\/Destinations\/HadoopFS-destination.html#concept_awl_4km_zq","attributes": {"data-id":"concept_awl_4km_zq",},"menu": {"hasChildren":true,},"tocID":"concept_awl_4km_zq-d46e90279","next":"concept_awl_4km_zq-d46e90279",},{"title":"HBase","shortdesc":"\n            <p class=\"shortdesc\">The HBase destination writes data to an HBase cluster. The destination can write data       to HBase as text, binary data,\n               or JSON strings. You can define the data format for each column       written to HBase.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/HBase.html#concept_wsz_5t5_vr","attributes": {"data-id":"concept_wsz_5t5_vr",},"menu": {"hasChildren":true,},"tocID":"concept_wsz_5t5_vr-d46e91675","next":"concept_wsz_5t5_vr-d46e91675",},{"title":"Hive Metastore","shortdesc":"\n            <p class=\"shortdesc\">The Hive Metastore destination works with the Hive Metadata processor and the Hadoop FS         or MapR FS destination as\n               part of the Drift Synchronization Solution for Hive. \n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/HiveMetastore.html#concept_gcr_z2t_zv","attributes": {"data-id":"concept_gcr_z2t_zv",},"menu": {"hasChildren":true,},"tocID":"concept_gcr_z2t_zv-d46e92058","next":"concept_gcr_z2t_zv-d46e92058",},{"title":"Hive Streaming","shortdesc":"\n            <p class=\"shortdesc\">The Hive Streaming destination writes data to Hive tables stored in the ORC (Optimized   Row Columnar) file format.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Hive.html#concept_kvs_3hh_ht","attributes": {"data-id":"concept_kvs_3hh_ht",},"menu": {"hasChildren":true,},"tocID":"concept_kvs_3hh_ht-d46e92653","next":"concept_kvs_3hh_ht-d46e92653",},{"title":"HTTP Client","shortdesc":"\n            <p class=\"shortdesc\">The HTTP Client destination writes data to an HTTP endpoint. The destination sends         requests to an HTTP resource URL.\n               Use the HTTP Client destination to perform a range of         standard requests or use an expression to determine the request\n               for each record.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/HTTPClient.html#concept_khl_sg5_lz","attributes": {"data-id":"concept_khl_sg5_lz",},"menu": {"hasChildren":true,},"tocID":"concept_khl_sg5_lz-d46e92752","next":"concept_khl_sg5_lz-d46e92752",},{"title":"InfluxDB","shortdesc":"\n            <p class=\"shortdesc\">The InfluxDB destination writes data to an InfluxDB database.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/InfluxDB.html#concept_inf_db_sr","attributes": {"data-id":"concept_inf_db_sr",},"menu": {"hasChildren":true,},"tocID":"concept_inf_db_sr-d46e93710","next":"concept_inf_db_sr-d46e93710",},{"title":"JDBC Producer","shortdesc":"\n            <p class=\"shortdesc\">The JDBC Producer destination uses a JDBC connection to write data to a database         table. You can also use the JDBC\n               Producer to write change capture data from a Microsoft SQL         Server change log. \n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/JDBCProducer.html#concept_kvs_3hh_ht","attributes": {"data-id":"concept_kvs_3hh_ht",},"menu": {"hasChildren":true,},"tocID":"concept_kvs_3hh_ht-d46e93767","next":"concept_kvs_3hh_ht-d46e93767",},{"title":"JMS Producer","href":"datacollector\/UserGuide\/Destinations\/JMSProducer.html#concept_sfz_ww5_n1b","attributes": {"data-id":"concept_sfz_ww5_n1b",},"menu": {"hasChildren":true,},"tocID":"concept_sfz_ww5_n1b-d46e93984","next":"concept_sfz_ww5_n1b-d46e93984",},{"title":"Kafka Producer","shortdesc":"\n            <p class=\"shortdesc\">The Kafka Producer destination writes data to a Kafka cluster. <span class=\"ph\">The destination can also send responses to a <a class=\"xref\" href=\"datacollector\/UserGuide\/Microservice\/Microservice_Title.html#concept_rzc_rbf_kfb\">microservice origin</a> when used in a <a class=\"xref\" href=\"datacollector\/UserGuide\/Microservice\/Microservice_Title.html#concept_qfh_xdm_p2b\">microservice pipeline</a>.</span></p>\n         ","href":"datacollector\/UserGuide\/Destinations\/KProducer.html#concept_oq2_5jl_zq","attributes": {"data-id":"concept_oq2_5jl_zq",},"menu": {"hasChildren":true,},"tocID":"concept_oq2_5jl_zq-d46e94352","next":"concept_oq2_5jl_zq-d46e94352",},{"title":"Kinesis Firehose","shortdesc":"\n            <p class=\"shortdesc\">The Kinesis Firehose destination writes data to an Amazon Kinesis Firehose delivery         stream. Firehose automatically\n               delivers the data to the Amazon S3 bucket or Amazon Redshift         table that you specify in the delivery stream.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/KinFirehose.html#concept_bjv_dpk_kv","attributes": {"data-id":"concept_bjv_dpk_kv",},"menu": {"hasChildren":true,},"tocID":"concept_bjv_dpk_kv-d46e95299","next":"concept_bjv_dpk_kv-d46e95299",},{"title":"Kinesis Producer","shortdesc":"\n            <p class=\"shortdesc\">The Kinesis Producer destination writes data to Amazon Kinesis Streams. <span class=\"ph\">The destination can also send responses to a <a class=\"xref\" href=\"datacollector\/UserGuide\/Microservice\/Microservice_Title.html#concept_rzc_rbf_kfb\">microservice origin</a> when used in a <a class=\"xref\" href=\"datacollector\/UserGuide\/Microservice\/Microservice_Title.html#concept_qfh_xdm_p2b\">microservice pipeline</a>.</span></p>\n         ","href":"datacollector\/UserGuide\/Destinations\/KinProducer.html#concept_swk_h1j_yr","attributes": {"data-id":"concept_swk_h1j_yr",},"menu": {"hasChildren":true,},"tocID":"concept_swk_h1j_yr-d46e95522","next":"concept_swk_h1j_yr-d46e95522",},{"title":"KineticaDB","href":"datacollector\/UserGuide\/Destinations\/KineticaDB.html#concept_hxh_5xg_qbb","attributes": {"data-id":"concept_hxh_5xg_qbb",},"menu": {"hasChildren":true,},"tocID":"concept_hxh_5xg_qbb-d46e95750","next":"concept_hxh_5xg_qbb-d46e95750",},{"title":"Kudu ","shortdesc":"\n            <p class=\"shortdesc\">The Kudu destination writes data to a Kudu cluster.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Kudu.html#concept_chy_xxg_4v","attributes": {"data-id":"concept_chy_xxg_4v",},"menu": {"hasChildren":true,},"tocID":"concept_chy_xxg_4v-d46e95898","next":"concept_chy_xxg_4v-d46e95898",},{"title":"Local FS","href":"datacollector\/UserGuide\/Destinations\/LocalFS.html#concept_zvc_bv5_1r","attributes": {"data-id":"concept_zvc_bv5_1r",},"menu": {"hasChildren":true,},"tocID":"concept_zvc_bv5_1r-d46e96049","next":"concept_zvc_bv5_1r-d46e96049",},{"title":"MapR DB","shortdesc":"\n            <p class=\"shortdesc\">The MapR DB destination writes data to MapR DB binary tables. The destination can write         data to MapR DB as text, binary\n               data, or JSON strings. You can define the data format for         each column written to MapR DB.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/MapRDB.html#concept_vxg_w2z_yv","attributes": {"data-id":"concept_vxg_w2z_yv",},"menu": {"hasChildren":true,},"tocID":"concept_vxg_w2z_yv-d46e96723","next":"concept_vxg_w2z_yv-d46e96723",},{"title":"MapR DB JSON","href":"datacollector\/UserGuide\/Destinations\/MapRDBJSON.html#concept_i4h_2kj_dy","attributes": {"data-id":"concept_i4h_2kj_dy",},"menu": {"hasChildren":true,},"tocID":"concept_i4h_2kj_dy-d46e97106","next":"concept_i4h_2kj_dy-d46e97106",},{"title":"MapR FS ","shortdesc":"\n            <p class=\"shortdesc\">The MapR FS destination writes files to MapR FS. You can write the data to MapR as flat         files or Hadoop sequence files.\n               \n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/MapRFS.html#concept_spv_xlc_fv","attributes": {"data-id":"concept_spv_xlc_fv",},"menu": {"hasChildren":true,},"tocID":"concept_spv_xlc_fv-d46e97478","next":"concept_spv_xlc_fv-d46e97478",},{"title":"MapR Streams Producer","shortdesc":"\n            <p class=\"shortdesc\">The MapR Streams Producer destination writes messages to MapR Streams.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/MapRStreamsProd.html#concept_cfj_qbn_2v","attributes": {"data-id":"concept_cfj_qbn_2v",},"menu": {"hasChildren":true,},"tocID":"concept_cfj_qbn_2v-d46e98564","next":"concept_cfj_qbn_2v-d46e98564",},{"title":"MongoDB","href":"datacollector\/UserGuide\/Destinations\/MongoDB.html#concept_eth_k5n_4v","attributes": {"data-id":"concept_eth_k5n_4v",},"menu": {"hasChildren":true,},"tocID":"concept_eth_k5n_4v-d46e98863","next":"concept_eth_k5n_4v-d46e98863",},{"title":"MQTT Publisher","shortdesc":"\n            <p class=\"shortdesc\">The MQTT Publisher destination publishes messages to a topic on an MQTT broker. The         destination functions as an MQTT\n               client that publishes messages, writing each record as a         message.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/MQTTPublisher.html#concept_odz_txt_lz","attributes": {"data-id":"concept_odz_txt_lz",},"menu": {"hasChildren":true,},"tocID":"concept_odz_txt_lz-d46e99145","next":"concept_odz_txt_lz-d46e99145",},{"title":"Named Pipe","shortdesc":"\n            <p class=\"shortdesc\">The Named Pipe destination writes data to a UNIX named pipe. </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/NamedPipe.html#concept_pl5_tdg_gcb","attributes": {"data-id":"concept_pl5_tdg_gcb",},"menu": {"hasChildren":true,},"tocID":"concept_pl5_tdg_gcb-d46e99299","next":"concept_pl5_tdg_gcb-d46e99299",},{"title":"Pulsar Producer","shortdesc":"\n            <p class=\"shortdesc\">The Pulsar Producer destination writes data to topics in an Apache Pulsar         cluster.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/PulsarProducer.html#concept_fq3_kpc_r2b","attributes": {"data-id":"concept_fq3_kpc_r2b",},"menu": {"hasChildren":true,},"tocID":"concept_fq3_kpc_r2b-d46e99685","next":"concept_fq3_kpc_r2b-d46e99685",},{"title":"RabbitMQ Producer","shortdesc":"\n            <p class=\"shortdesc\">RabbitMQ Producer writes AMQP messages to a single RabbitMQ queue. </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/RabbitMQ.html#concept_pxj_rvy_dv","attributes": {"data-id":"concept_pxj_rvy_dv",},"menu": {"hasChildren":true,},"tocID":"concept_pxj_rvy_dv-d46e99839","next":"concept_pxj_rvy_dv-d46e99839",},{"title":"Redis","shortdesc":"\n            <p class=\"shortdesc\">The Redis destination writes data to Redis. </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Redis.html#concept_ktc_gw2_gw","attributes": {"data-id":"concept_ktc_gw2_gw",},"menu": {"hasChildren":true,},"tocID":"concept_ktc_gw2_gw-d46e99938","next":"concept_ktc_gw2_gw-d46e99938",},{"title":"Salesforce","shortdesc":"\n            <p class=\"shortdesc\">The Salesforce destination writes data to Salesforce objects.</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Salesforce.html#concept_rlb_rt3_rx","attributes": {"data-id":"concept_rlb_rt3_rx",},"menu": {"hasChildren":true,},"tocID":"concept_rlb_rt3_rx-d46e100224","next":"concept_rlb_rt3_rx-d46e100224",},{"title":"SDC RPC","shortdesc":"\n            <p class=\"shortdesc\">The SDC RPC destination enables connectivity between two SDC RPC pipelines. The SDC RPC     destination passes data to one\n               or more SDC RPC origins. Use the SDC RPC destination as part of     an SDC RPC origin pipeline.\n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/SDC_RPCdest.html#concept_lfk_hx2_ct","attributes": {"data-id":"concept_lfk_hx2_ct",},"menu": {"hasChildren":true,},"tocID":"concept_lfk_hx2_ct-d46e100441","next":"concept_lfk_hx2_ct-d46e100441",},{"title":"Send Response to Origin","href":"datacollector\/UserGuide\/Destinations\/SendResponse.html#concept_eyd_zx4_q2b","attributes": {"data-id":"concept_eyd_zx4_q2b",},"menu": {"hasChildren":true,},"tocID":"concept_eyd_zx4_q2b-d46e100598","next":"concept_eyd_zx4_q2b-d46e100598",},{"title":"Solr","shortdesc":"\n            <p class=\"shortdesc\">The Solr destination writes data to a Solr node or cluster. </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Solr.html#concept_z2g_q1r_wr","attributes": {"data-id":"concept_z2g_q1r_wr",},"menu": {"hasChildren":true,},"tocID":"concept_z2g_q1r_wr-d46e100653","next":"concept_z2g_q1r_wr-d46e100653",},{"title":"Splunk","shortdesc":"\n            <p class=\"shortdesc\">The Splunk destination writes data to Splunk using the Splunk HTTP Event Collector         (HEC).</p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Splunk.html#concept_zzr_pqn_xdb","attributes": {"data-id":"concept_zzr_pqn_xdb",},"menu": {"hasChildren":true,},"tocID":"concept_zzr_pqn_xdb-d46e100813","next":"concept_zzr_pqn_xdb-d46e100813",},{"title":"Syslog","shortdesc":"\n            <p class=\"shortdesc\">The Syslog destination writes syslog messages to a Syslog server. </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#concept_idr_ct5_w2b","attributes": {"data-id":"concept_idr_ct5_w2b",},"menu": {"hasChildren":true,},"tocID":"concept_idr_ct5_w2b-d46e101036","next":"concept_idr_ct5_w2b-d46e101036",},{"title":"To Error ","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Destinations\/ToError.html","attributes": {"data-id":"concept_ryn_v3z_lr",},"menu": {"hasChildren":false,},"tocID":"concept_ryn_v3z_lr-d46e101325","topics":[]},{"title":"Trash","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Destinations\/Trash.html#concept_htf_ydj_wq","attributes": {"data-id":"concept_htf_ydj_wq",},"menu": {"hasChildren":false,},"tocID":"concept_htf_ydj_wq-d46e101349","topics":[]},{"title":"WebSocket Client","shortdesc":"\n            <p class=\"shortdesc\">The WebSocket Client destination writes data to a WebSocket endpoint. Use the         destination to send data to a WebSocket\n               resource URL. \n            </p>\n         ","href":"datacollector\/UserGuide\/Destinations\/WebSocketClient.html#concept_l4d_mjn_lz","attributes": {"data-id":"concept_l4d_mjn_lz",},"menu": {"hasChildren":true,},"tocID":"concept_l4d_mjn_lz-d46e101373","next":"concept_l4d_mjn_lz-d46e101373",}]});